import React, { useState, useEffect } from 'react';
import '../static/tickets.css';
export default function Tickets () {
  const ticketData = [
    { id: 1, payment: 'Paid', seatNumber: 'A1' },
    { id: 2, payment: 'Pending', seatNumber: 'B2' },
    { id: 3, payment: 'Paid', seatNumber: 'C3' },
  ];
  return (
	  <div className='tickets-container'>
	   <div className='tickets'>
	  <h2>My Tickets<i className="fas fa-ticket-alt ticket-icon"></i></h2>
	   <p>View all tickets you have booked</p>
	  </div>
          <table className="ticket-table">
          <thead>
            <tr>
              <th>Ticket ID</th>
              <th>Payment</th>
              <th>Seat Number</th>
              {/* Add additional table headers as needed */}
            </tr>
          </thead>
          <tbody>
            {ticketData.map((ticket) => (
              <tr key={ticket.id}>
                <td>{ticket.id}</td>
                <td>{ticket.payment}</td>
                <td>{ticket.seatNumber}</td>
                {/* Add additional table cells for other columns */}
              </tr>
            ))}
          </tbody>
        </table>
	  </div>
  );
}
